import logo from "../../logofooter.png";
import footer from "../../footer.png";
import { BsTelephoneOutbound } from "react-icons/bs";
import "./nav.css";
function Footer() {
	return (
		<div
			className='headhead'
			style={{
				backgroundImage: `url(${footer})`,
				height: "447px",
				backgrounPosition: "center",
				backgroundPosition: "0px -160px",
			}}
		>
			<div>
				<img src={logo} className='logo text-white' alt='logo' />
				<h1 className='text-white fs-6 fw-light mt-3'>
					10 New Town Street, V2 5NW,
				</h1>
				<h1 className='text-white fs-6 fw-light'>Newstate, USA.</h1>
				<p className='p2 mt-4 d-flex text-white  align-items-center'>
					<BsTelephoneOutbound
						style={{
							marginRight: 5,
							width: 20,
							height: 20,
							color: "white",
						}}
					/>
					+88 01924 184 461
				</p>
			</div>
		</div>
	);
}

export default Footer;
